00a7713e-a360-4848-a526-1a13a2f3c4e9.prompt:
- id: 36
  name: generics
  description: "Use generics for type-safe reusable code"
  language: swiftlang
  code: |
    // Generic function
    func swapValues<T>(_ a: inout T, _ b: inout T) {
        let temp = a
        a = b
        b = temp
    }

    // Generic struct
    struct Stack<Element> {
        private var items: [Element] = []

        mutating func push(_ item: Element) {
            items.append(item)
        }

        mutating func pop() -> Element? {
            items.popLast()
        }

        var top: Element? {
            items.last
        }

        var isEmpty: Bool {
            items.isEmpty
        }
    }

    // Type constraint
    func largest<T: Comparable>(_ a: T, _ b: T) -> T {
        a > b ? a : b
    }

    // Multiple constraints
    func printSorted<T: Comparable & CustomStringConvertible>(_ items: [T]) {
        let sorted = items.sorted()
        print(sorted.map { $0.description }.joined(separator: ", "))
    }

    // Usage
    var x = 3, y = 7
    swapValues(&x, &y)
    print(x, y) // 7, 3

    var stack = Stack<Int>()
    stack.push(1)
    stack.push(2)
    print(stack.pop() ?? 0) // 2

    print(largest(3, 7))            // 7
    print(largest("alpha", "beta")) // beta

034b9139-0a3c-49dd-8ee3-6a53b3224972.prompt:
- id: 44
  name: property_wrappers
  description: "Create and use property wrappers"
  language: swiftlang
  code: |
    // Property wrapper that clamps a value to a range
    @propertyWrapper
    struct Clamped {
        var value: Int
        let range: ClosedRange<Int>

        var wrappedValue: Int {
            get { value }
            set { value = min(max(newValue, range.lowerBound), range.upperBound) }
        }

        init(wrappedValue: Int, _ range: ClosedRange<Int>) {
            self.range = range
            self.value = min(max(wrappedValue, range.lowerBound), range.upperBound)
        }
    }

    // Property wrapper that trims whitespace
    @propertyWrapper
    struct Trimmed {
        private var value: String = ""

        var wrappedValue: String {
            get { value }
            set { value = newValue.trimmingCharacters(in: .whitespaces) }
        }

        init(wrappedValue: String) {
            self.wrappedValue = wrappedValue
        }
    }

    struct Player {
        @Clamped(0...100) var health: Int = 100
        @Trimmed var name: String
    }

    var player = Player(name: "  Alice  ")
    print(player.name)   // "Alice"

    player.health = 150
    print(player.health) // 100 (clamped)

    player.health = -10
    print(player.health) // 0 (clamped)

