        var errorDescription: String? {
            switch self {
            case .notFound:
                return "Item not found"
            case .invalidInput(let field):
                return "Invalid input: \(field)"
            case .networkError(let code, let msg):
                return "Network error \(code): \(msg)"
            }
        }
    }

