        }
        return "Alice"
    }

    // Handle errors with do-try-catch
    do {
        let user = try findUser(id: 1)
        print("Found: \(user)")
    } catch AppError.notFound {
        print("Not found")
    } catch AppError.invalidInput(let field) {
        print("Invalid: \(field)")
    } catch {
        print("Error: \(error)")
    }

    // try? returns nil on error
    let user = try? findUser(id: 999)
    print(user ?? "Not found")

